        left: 0;
        right: 0;

        font-weight: 600;
        letter-spacing: 0.2px;
        margin: 10px 0;
        padding-right: 25px;
      }

        display: flex;
        align-content: center;
        justify-content: center;
      }

        margin: auto;
        padding: 30px;
        border-radius: 10px;
        background: rgba(0, 0, 0, 0.03);
      }

      .sb-nopreview_heading {
        text-align: center;
      }

        border: 20px solid rgb(187, 49, 49);
        background: #222;
        color: #fff;
        z-index: 999999;
      }

        padding: 10px;
        background: #000;
        color: #eee;

          'Andale Mono', 'Lucida Console', Consolas, Monaco, monospace;
